description:
Апартаменти із видом на місто в ЖК бізнес класу Be the One за 5 хвилин пішки від метро Академмістечко та Житомирська.

  Зроблений новий дизайнерський ремонт у сучасному стилі повністю оснащена комфортними меблями які виготовленні під індивідуальне замовлення та технікою;
- зручна кухня;
-електрочайник;
- мікрохвильова піч;
-холодильник;
-варочна поверхня ;
-телевізор;
-барна стійка;
-праска;
-фен
    Також є необхідний посуд. 
Зручне ліжко з ортопедичним матрасом та нішею для зберігання постілі , просторий санвузол з душовою кабіною, пральна машина, бойлер. 
В коридорі вмістка зручна шафа-купе .

  У дворі знаходиться ТЦ Академсіті де є все необхідне: аптеки, супермаркет VARUS,кафе : Molino і Сушия; хімчистка, магазини з сухофруктами, одяг та взуття,приват банк поруч.
  Зручна транспортна розв'язка. 

  За 10км від Михайлівського Золотоверхого монастиря та 12 км від Володимирського собору.
Квартира-Студія 21кв.м в сучасному будинку в якому поєднані комфорт і сучасні технології. При вході в під'їзд вас зустрічає консьєрж з охороною, а також просторе лобі для загального користування де ви зможете попрацювати зі смачною кавою, кавомашини розташовані поряд, підземний паркінг, швидкісні ліфти.

  Можлива оренда почасово.Час заселення 15.00 час виселення до 11.00

  Вартість оренди квартири залежить від кількості днів проживання та від дня тижня, ціну уточняйте у менеджера,за номером телефону,який вказаний в оголошенні.
Дана ціна вказана за оренду від 7 днів

  В квартирі заборонено курити та організовувати вечірки.

  Будемо раді зустрічі з Вами)

Продається 2 к.кв. (євро-3) в ЖК Нова Англія, будинок Брайтон вул. Михайла Максимовича, 26. 

Поверховість: 18/21 Площа: 60/28/15. 

Квартира після будівельників. Заведена гаряча та холодна вода, зроблено стяжку під ламінат, встановлено радіатори з регуляторами тепла, проведено електрику. На все встановлено лічильники (опалення, електрика, холодна/гаряча вода). 

Можна заходити на ремонт. В під'їзді 3 ліфта: 2 вантажних і пасажирський. 

Переваги комплексу:
- локація, центр Голосієво, до метро Васильківська пішки 10 хвилин;
- закрита територія з охороною 24/7 і відеоспостереженням, пропускна система в'їзду;
- підземний паркінг (відповідає вимогам об'єкта цивільного захисту населення як бомбосховище);
- школа та дитячий садок на території;
- дитячі та спортивні майданчики, прогулянкові алеї, зони відпочинку;
- окрема територія для вигулу домашніх тварин; 
- безліч кав'ярень, кафе, ресторанів, магазинів, еко-лавок, салонів краси та ін.;
- вишуканий ландшафтний дизайн.
